(2, '帮助中心', 'help1', '帮助中心', '', NULL, 1, '', 0, 0, '2010-12-04 16:35:15', 0, '2010-12-04 16:35:15', NULL, 1, 0, 1, 1, 'page', 0),
(4, '关于我们', 'about', '关于我们摘要', '艺柏家-创意百分百，生活艺柏家\n\n“艺柏家”是北京九一格国际文化有限公司旗下的全新品牌。\n“艺柏家”一方面将继续秉承9IBOX的原创精神，致力于创意文化传播，创意概念商品化，营造创意文化平台；另一方面，作为一个全新诞生的创意精品品牌，“艺柏家”将借助现代化电子商务平台，汇集历经市场考验成功原创精品，同时借助线上线下平台的良性互动，不断提升创意精品的产品品质，为热爱创意生活的用户提供深入细致的服务。\n“勤俭务实、敬业创新、兼容并蓄、诚信立业”既是我们的经营宗旨，也是我们的座右铭。我们努力发掘每一个创意概念的价值，并将其通过我们集合的强大平台放大，深入激发其商业潜质，充分扩张其品牌影响。\n\n对于原创设计师：\n\n我们提供优质专业的销售服务平台， 给每一位热爱设计和手工的人一个展示+创业的机会，有精神上的追求也有物质上的财富。\n时至今日，已经有200多位独立设计师集结在这个平台，其中有不少设计师在这里开始了成功的创业之路，找到了未来的事业方向。\n艺柏家是设计师的朋友，我们将竭尽所能支持每一个拥有梦想的设计师，帮助大家实现精彩理念，共同发展，让创意成就价值。\n\n对于热爱生活的人：\n\n我们提供创意+设计的趣味生活解决方案，提供上千件不同种类不同领域的精彩创意。\n\n礼物提案：让对方永远猜不到礼物的内容，却总在打开的那一瞬间喜悦难禁。\n居家格调：家居美化并不止于家装，多种多样家居配饰也许会在周末和下班后带给你别样的惊喜。\n创你型格：非常主流、边缘文化、温暖清澈，灰调歌特，搞怪喜剧，饰品武装试试多维度的表达你自己。\n创意生活：行动起来！你就是生活的设计师，用身边的任何东西通过再创意加以利用，设计其实并不难。\n\n艺柏家也是所有热爱生活热爱创意者的朋友，我们将为大家网络中国最优质的原创产品，让你的生活充满乐趣和精彩。\n', NULL, 1, '', 0, 0, '2010-12-05 14:40:27', 0, '2010-12-21 15:19:38', 14, 1, 0, 1, 1, 'page', 0),
(8, '团购服务', 'coupon', '团购服务', '艺柏家愿意竭诚与各企业事业单位和各类的组织机构合作，为您提供礼品定制、吉祥物设计、品牌形象开发制作等一系列业务。\n\n欢迎各位致电大客户服务专线：010-65288934\n\n同时，我们也将面对广大用户不定期举办各种团购活动，请持续关注我们\n\n网站：www.100jia.cc\n微博：http://t.sina.com.cn/9ibox', NULL, 1, '', 0, 0, '2010-12-05 14:42:20', 0, '2010-12-21 15:33:18', 14, 1, 0, 1, 1, 'page', 0),
(9, '商铺合作', 'istore', '商铺合作', '艺柏家欢迎全国各地致力于从事创意产品销售的经销商加盟合作。\n\n具体合作政策根据合作区域、合作规模、合作模式的不同有所分别。详细细节欢迎来人来函来电垂询：\n\n产品\\\\招商部：010-65288934', NULL, 1, '', 0, 0, '2010-12-05 14:43:17', 0, '2010-12-21 15:26:14', 14, 1, 0, 1, 1, 'page', 0),
(10, '零售店铺', 'outlets', '零售店铺', '欢迎您光临艺柏家及9ibox的所有实体店，直接浏览并触摸丰富的产品\n\n北京地区\n\n王府井APM店 王府井黄金CBD\n地址：北京市东城区王府井大街新东安市场B1层-kb1-1\n\n富力广场店   CBD南大门与居住社区\n地址:北京市朝阳区富力广场B1层C06\n\n南锣鼓巷店   南锣鼓巷旅游区\n地址：北京市东城区南锣鼓巷91号\n\n东方银座店  东城区 东直门交通枢纽兼东直门CBD\n地址：北京东直门东方银座地下B1\n\n十里堡华堂店  朝阳CBD与综合居民区\n地址：北京十里堡新华堂二层\n\n西直门嘉茂店   西直门交通枢纽与西CBD\n地址：北京西城区西直门嘉茂购物中心四层\n\n望京嘉茂店  望京超级社区\n地址：北京朝阳区望京嘉茂购物中心三层\n\n崇文门新世界店\n地址：北京祈年大街 新世界三期商场一层\n\n\n\n', NULL, 1, '', 0, 0, '2010-12-05 14:44:48', 0, '2010-12-21 15:24:00', 14, 1, 0, 1, 1, 'page', 0),
(34, '隐私说明', 'privacy', '隐私说明', '隐私申明\n\n    欢迎访问艺柏家！我们以本隐私申明声明对访问者隐私保护的许诺。以下文字公开我\n\n站（100jia.cc）对信息收集和使用的情况。本站的隐私申明正在不断改进中，随着我站服\n\n务范围的扩大，我们会随时更新我们的隐私申明。我们欢迎您随时会来查看本申明。请随\n\n时向我们反馈您的意见。\n\n\n    在同意艺柏家服务协议之时，你已经同意我们按照本隐私申明来使用和披露您的个人\n\n信息。本隐私申明的全部条款属于该协议的一部份。\n\n\n    用户名和密码\n当您打算注册成用户后，我们要求您选择一个用户名和密码，您只能通过您的密码来使用\n\n您的帐号。如果您泄漏了密码，您可能丢失了您的个人识别信息，并且有可能导致对您不\n\n利的司法行为。因此不管任何原因使您的密码安全受到危及，您应该立即通过和我们取得\n\n联系。\n\n\n    购买信息\n当您决定在我网站购买产品时，我们要求您填写快递信息，包括真实姓名，地址，电话号\n\n码，和电子邮件地址。您还有权选择来填写附加信息。我们使用这些信息来获得用户的统\n\n计资料。我们将会用这些统计数据来给我们的用户分类，以便有针对性地向我们的用户提\n\n供新的服务。我们会通过您的邮件地址来通知您这些新的服务。\n\n\n    您的交易行为\n我们跟踪IP地址仅仅只是为了安全的必要。如果我们没有发现任何安全问题，我们会及时\n\n删除我们收集到的IP地址。我们还跟踪全天的页面访问数据。全天页面访问数据被用来反\n\n映网站的流量，一是我们可以为未来的发展制定计划（例如，增加服务器）。\n\n\n    邮件/短信/会刊服务\n艺柏家会保留通过邮件、短信等形式，对本网站注册、购物用户发送订单信息、促销活动\n\n等告知服务的权利。如果您在我网站注册、购物，表明您已默示同意接受此项服务。 如果\n\n您不想接收来自我们的邮件、短信或会刊，您可以向客服提出退阅申请。\n\n\n    第三方\n我们不会向任何第三方提供，出售，出租，分享和交易用户的个人信息，除非第三方和我\n\n们一起为网站和用户提供服务并且在该服务结束后已将被禁止访问包括其以前能够访问的\n\n所有这些资料。当我们被法律强制或依照政府要求提供您的信息时我们将善意地披露您的\n\n资料。\n\n\n    安全\n我们网站有相应的安全措施来确保我们掌握的信息不丢失，不被滥用和变造。这些安全措\n\n施包括向其它服务器备份数据和对用户密码加密。尽管我们有这些安全措施，但请注意在\n\n因特网上不存在“完善的安全措施”。', NULL, 1, '', 0, 0, '2010-12-21 23:34:26', 1, '2010-12-22 12:43:07', 14, 1, 0, 1, 1, 'page', 0),
(12, '联系我们', 'contact', '联系我们', '地址：北京市东城区甘雨胡同53号万博写字楼 201-204室\n产品\\\\招商部：010-65288934\n客服\\\\财务部：010-65281345\n电子邮箱：iboxcn@126.com\n \n产品审核\n如果您希望将宝贝放进格子公社，将先将照片发到下面的邮件地址并与产品部联系。\n电子邮箱：jesly82@sina.com\n　\n商务合作\n欢迎优势互补的公司与我们合作开拓业务，请简要描述您的合作意向发送到下面的邮件地址。\n电子邮箱：33.sun@163.com\n　\n人员招聘\n我们正在寻找最优秀和最具工作热情的员工。如果您有意加入我们的团队，请将简历发送到下面的邮件地址。\n电子邮箱：nelly_sun@hotmail.com\n\n有关商品、订单查询等问题请各位用户尽量将邮件发送到客户服务信箱和客户满意监督信箱，以便获得最快的回复！ \n\n100+艺柏家售后热线 \n退换货、投诉等，请拨打艺柏家售后热线：400-650-8536 \n\n客户满意监督 \n客户满意监督邮箱  service@100jia.cc\n感谢您不吝赐教。\n\n\n', NULL, 1, '', 0, 0, '2010-12-05 14:46:44', 0, '2010-12-21 15:22:27', 14, 1, 0, 1, 1, 'page', 0),
(14, '注册新用户', 'register', '注册新用户', '您只要通过 100jia.cc 注册开户，即可成为艺柏家网站会员，在网站进行购买和支付收藏活动。\r\n\r\n在100jia.cc注册可以通过以下途径：\r\n\r\n1.进入网站后，点击首页上方“免费注册”，将进入注册页面，在相应提示处输入您的昵称、邮箱地址、密码（密码设置不要过于简单）；确认密码后点击“完成注册”即可。\r\n\r\n2.注册用户名是唯一的。注册成功后，您可以到网站“我的帐户-个人信息管理”进行个人信息的更新。\r\n\r\n3.如果您需要收藏某项单品或者将产品放入购物车，系统将自动要求您进行登录或者注册。\r\n', NULL, 1, '', 0, 0, '2010-12-05 14:50:02', 0, '2010-12-06 11:18:37', 14, 1, 0, 1, 1, 'page', 0),
(15, '会员制度', 'membership', '会员制度', '建设中……', NULL, 1, '', 0, 0, '2010-12-05 14:51:17', 0, '2010-12-06 12:36:51', 14, 1, 0, 1, 1, 'page', 0),
(16, '我的账户管理', 'features', '用户中心功能介绍', '选择“我的账户”，用户可以进行一系列的个人账户管理功能\r\n\r\n1、在“我的账户”中，用户可以进行交易管理，查询订单状况。管理个人已经购买的商品和收藏过的商品。\r\n\r\n2、在“我的账户”中，用户还可以进行个人信息管理，包括修改个人资料，修改密码，修改送货地址等信息。\r\n\r\n', NULL, 1, '', 0, 0, '2010-12-05 14:52:06', 0, '2010-12-06 11:53:14', 14, 1, 0, 1, 1, 'page', 0),
(17, '如何找回密码', 'findpasswd', '如何找回密码', '如果您在登录过程中遗忘了个人密码，请在登录页面中直接选择“忘记密码”选项，在页面指引和提示中一一找回密码。', NULL, 1, '', 0, 0, '2010-12-05 14:54:51', 0, '2010-12-06 12:36:19', 14, 1, 0, 1, 1, 'page', 0),
(18, '订购流程', 'order_process', '订购流程', '艺柏家商城在线购物流程\r\n\r\n第一步：选购\r\n浏览/搜索您所需要的商品，确定购买数量，点击“放入购物车”。 \r\n\r\n第二步：加入购物车\r\n放入购物车后，如果您还想购买其他感兴趣的商品，点击购物车中的“继续购物”或者进入其他页面、搜索商品继续购买。\r\n\r\n第三步：登录/注册\r\n如果您未在艺柏家注册登记过，请点击新用户注册页面，只需要几秒，填写基本的注册信息，完成注册，然后登录。 \r\n\r\n第四步：填写核对订单信息\r\n请您详细准确填写您的收货人信息、收货地址、电话、Email、电话、邮编等资料。\r\n\r\n第五步：选择付款方式\r\n选择支付宝作为支付方法， 点击“确认支付”按钮。\r\n\r\n第六步 选择送货时间\r\n在列表中给出的送货时间中选择最适合自己的一种，并点击“确认时间”。\r\n\r\n第七步：生成订单\r\n再次检查您所有填写的项目，以保证配送信息正确。如果有特殊说明，请在“填写附加说明”框内里填写详细情况。提交订单后，并且您的邮箱将会收到一封订单确认信。请您记住订单编号以便日后查询。\r\n\r\n第八步：发货\r\n客服人员核实完订单后一般24小时内即可发货，同时会有短信通知您快递公司和快递单号。\r\n\r\n第九步：验收商品\r\n当您收到货物后，请仔细核对您所订购的商品种类、数量、规格，合格后，请在送货单上签字。如果您对我们的服务和商品不满意，请勿拆开、损坏商品及外包装，并欢迎您拨打我们的投拆电话400-650-8536，提出您的意见和建议，帮助我们提高服务质量。\r\n', NULL, 1, '', 0, 0, '2010-12-05 14:56:51', 0, '2010-12-06 11:27:44', 14, 1, 0, 1, 1, 'page', 0),
(19, '支付方式', 'payment', '支付方式', '支付方式：在线支付\r\n\r\n1．艺柏家为您提供“支付宝”在线支付方式，请确认您的银行卡已经开通相应针对支付宝的支付功能。\r\n\r\n2．银行卡的开通\r\n因各地银行政策不同，建议您在网上支付前拨打所在地银行电话，咨询该行可供网上支付的银行卡种类及开通手续。\r\n\r\n3．支付金额上限\r\n目前各银行对于网上支付均有一定金额的限制，由于各银行政策不同，建议您在申请网上支付功能时向银行咨询相关事宜。\r\n\r\n4、怎样判断网上支付是否成功？\r\n1）当您完成网上在线支付过程后，系统应提示支付成功；如果系统没有提示支付失败或成功，您可通过电话、ATM 、柜台或登录网上银行等各种方式查询银行卡余额，如果款项已被扣除，说明您已支付成功。\r\n2）若由于网络故障导致您已支付成功的订单未改变订单状态，请您联系我们的客服人员为您解决。\r\n3）如果出现信用卡超额透支、存折余额不足、意外断线等导致支付不成功，请您登录艺柏家网站，在“我的账户”中查找到该张未支付成功的订单，重新完成支付。\r\n\r\n温馨提示：请您在订购成功后3天内完成支付，否则我们将不会保留您的订单。\r\n', NULL, 1, '', 0, 0, '2010-12-05 14:57:47', 0, '2010-12-06 11:56:20', 14, 1, 0, 1, 1, 'page', 0),
(20, '如何修改订单', 'modify_order', '如何修改订单', '如果您希望修改订单的产品数量或者产品名称，请直接登录网站，进入“我的账户”页面，点击“已买到的产品”，进行相应的修改。', NULL, 1, '', 0, 0, '2010-12-05 14:57:51', 0, '2010-12-06 11:58:16', 14, 1, 0, 1, 1, 'page', 0),
(21, '如何取消订单', 'cancel_order', '如何取消订单', '如果您希望取消已经订购的产品，请直接登录网站，进入“我的账户”页面，点击“已买到的产品”，进行相应的取消。', NULL, 1, '', 0, 0, '2010-12-05 14:59:14', 0, '2010-12-06 11:58:58', 14, 1, 0, 1, 1, 'page', 0),
(22, '配送方式', 'shipping_method', '关于配送方式', '艺柏家商品配送统一采用普通快递的配送方法。\r\n\r\n商品发货后由快递公司统一配送，如在正常配送时间范围内还没收到商品，可能是以下几种原因：\r\n1、 您的送货地址或邮编填写错误；\r\n2、 快递方式，送货地址超出送货上门范围；\r\n3、 快递送货时没有联系上收货人；\r\n4、 如果订单支付方式为“非货到付款”，送货时间是从收到货款开始计算；\r\n5、 可能在运输过程中，由于不可抗力造成延迟。\r\n发生这种情况，您可以通过我们的售后服务热线 400-650-8536查询货品情况。\r\n', NULL, 1, '', 0, 0, '2010-12-05 15:01:22', 0, '2010-12-06 12:40:06', 14, 1, 0, 1, 1, 'page', 0),
(23, '关于快递的说明', 'express_instructions', '关于快递说明', '一般来说您下单之后24小时之内即可发货，除重大节假日外，3－5天后可以送达到您的手中，根据城市不同略有区别。\r\n您的订单如果是在当天16点之前生成，并完成支付，则您的订单就会在当天发货；如果您的订单是在当天16点之后生成并完成支付，则会在次日上午发货。\r\n北京、上海、天津等一线城市基本可以在次日到达。', NULL, 1, '', 0, 0, '2010-12-05 15:02:03', 0, '2010-12-06 12:40:50', 14, 1, 0, 1, 1, 'page', 0),
(25, '商品的验货与签收', 'inspection', '商品的验货与签收', '快递送货上门时，请您务必当面对照发货单核对商品，如果出现商品数量缺少、商品破损等情况，请您当场办理整单商品的拒收。若订单中含有特惠品，请一并退回。一旦您确认签字，我们视同您确认商品配送准确完整，将无法为您办理退换或补发。', NULL, 1, '', 0, 0, '2010-12-05 15:02:50', 0, '2010-12-06 12:00:09', 14, 1, 0, 1, 1, 'page', 0),
(26, '退换货政策', 'return_policy', '退换货政策', '快递送货上门时，请您务必当面对照发货单核对商品，如果出现商品数量缺少、商品破损等情况，请您当场办理整单商品的拒收。若订单中含有特惠品，请一并退回。一旦您确认签字，我们视同您确认商品配送准确完整，将无法为您办理退换或补发。\r\n\r\n注：图片及信息仅供参考，不属质量问题。因拍摄灯光及不同显示器色差等问题可能造成商品图片与实物有一定色差，这不属于质量问题，一切以实物为准。\r\n\r\n如本站有其他活动，活动期间退换政策请咨询 400-650-8536。\r\n', NULL, 1, '', 0, 0, '2010-12-05 15:03:46', 0, '2010-12-06 11:32:17', 14, 1, 0, 1, 1, 'page', 0),
(27, '如何办理退换货', 'apply_return', '如何办理退换货', '\r\n退换货流程\r\n1. 收到货品时，可打开商品包装检查商品是否完好无损，如果商品存在质量问题请整单拒收，不支持部分拒收。\r\n2. 为保障您的权益，请与配送员当面核对商品种类、数量、规格、赠品、金额等是否与订单一致，准确无误再进行签收。配送员离开后，艺柏家将不接受任何形式的退换货。\r\n3. 如因特殊原因需退换货，请联系艺柏家客服400-650-8536咨询办理。\r\n4. 关于退换货产生的费用问题，请具体咨询客服400-650-8536了解相关政策\r\n5. 退换商品需包装完好，请将发票、发货单、退换货申请单及相关赠品，于退换货时一并退回，以确保正常为您办理退换货。\r\n6. 退款方式与您的支付方式一致，同时收回促销礼券、赠品及相应积分，银行卡退款到账时间与各银行业务相关。\r\n\r\n \r\n 不予退换货的情况（包含但不限于）：\r\n1. 非艺柏家所售商品，退货产品与订单不符，购买者无法提供购买凭证的；\r\n2. 因您个人原因造成的商品损坏，商品和配件有使用磨损；\r\n3. 商品返回艺柏家的过程中由于包装或运输操作不当造成损坏；\r\n4. 不能提供随退换货一同购买的赠品/特惠品的。\r\n\r\n艺柏家对于退换货政策有最终解释权', NULL, 1, '', 0, 0, '2010-12-05 15:04:35', 0, '2010-12-06 12:12:50', 14, 1, 0, 1, 1, 'page', 0),
(28, '如何办理退款', 'refund', '如何办理退款', '订单可能会因为缺货或退货产生余款，退款方式与您的支付方式一致，将您购物账户中的余额退回您的支付宝账号中。', NULL, 1, '', 0, 0, '2010-12-05 15:05:22', 0, '2010-12-06 12:42:54', 14, 1, 0, 1, 1, 'page', 0),
(29, '发票制度说明', 'invoice', '发票制度说明', '﻿1、索取发票\n\n为零售订单索取发票，需要支付货款总额17%额度作为税点。如您进行团购或者大宗购买确定需要索取发票，请致电客服人员索取发票。\n \n2、发票抬头\n\n 发票抬头不能为空，您可填写个人或单位名称。\n \n3、发票内容\n\n 发票的内容栏可以选择办公用品或玩具\n', NULL, 1, '', 0, 0, '2010-12-05 15:06:09', 0, '2010-12-07 12:35:50', 14, 1, 0, 1, 1, 'page', 0),
(30, '关于购物优惠', 'vouchers', '关于体验券的使用', '艺柏家真诚的欢迎来自全国各地的用户在线购买高品质原创手工类产品，未来我们将不断完善会员体系，为用户提供更多的购物优惠选择。\r\n\r\n我们会不定期的会通过各种渠道向用户发送艺柏家的优惠券或者打折卡，优惠券都会包含面值，消费限额和有效时间，而打折卡将持续为您提供购买中的折扣服务。\r\n\r\n如果您希望获得更多的购物优惠政策，请持续关注我们的网站或者微博\r\nt.sina.com.cn/9ibox 也希望您可以经常向我们提出您的建议和意见，可能某一天您就会收到我们的优惠券或者打折卡。\r\n', NULL, 1, '', 0, 0, '2010-12-05 15:07:16', 0, '2010-12-06 12:49:58', 14, 1, 0, 1, 1, 'page', 0),
(31, '关于产品包装与贺卡', 'packaging', '关于产品包装与贺卡', '艺柏家的产品均出自设计师的手工原创，所以在质地和尺寸上各有不同。\r\n在产品销售中，我们会直接采用设计师提供的包装；如设计师并未提供配套包装，则由艺柏家进行基础简易包装。\r\n如果您购买产品是用于礼品赠送，希望配合贺卡的话，请您直接在购买过程中填写贺卡需求和贺卡内容，艺柏家将免费为您提供贺卡传情服务。', NULL, 1, '', 0, 0, '2010-12-05 15:07:41', 0, '2010-12-06 12:57:15', 14, 1, 0, 1, 1, 'page', 0),
