(42, '东方银座店', 'B07', '东方银座店', '<p><p>\n	<img alt=\\"shop_7_1.jpg\\" name=\\"shop_7_1.jpg\\" mce_src=\\"http://imp.100jia.cc/c/101230/file_33077cec823333ad2262bd36e4971306.jpg\\" src=\\"http://imp.100jia.cc/c/101230/file_33077cec823333ad2262bd36e4971306.jpg\\">\n</p>\n<p>\n	<img alt=\\"shop_7_3.jpg\\" name=\\"shop_7_3.jpg\\" mce_src=\\"http://imp.100jia.cc/c/101230/file_4cab42eec7dd459be6a9c8fe02cc6249.jpg\\" src=\\"http://imp.100jia.cc/c/101230/file_4cab42eec7dd459be6a9c8fe02cc6249.jpg\\">\n</p>\n<p>\n	<img alt=\\"shop_7_2.jpg\\" name=\\"shop_7_2.jpg\\" mce_src=\\"http://imp.100jia.cc/c/101230/file_d32f87956a4aa076e0c2343a02c089ba.jpg\\" src=\\"http://imp.100jia.cc/c/101230/file_d32f87956a4aa076e0c2343a02c089ba.jpg\\">\n</p>\n</p><p>东方银座店<br><br>东城区东直门交通枢纽兼东直门CBD<br><br>地址：北京东直门东方银座地下B1。<br><br>垂询电话：010-84476811<br mce_bogus=\\"1\\"></p>', NULL, 1, '', 0, 0, '2010-12-26 21:16:22', 1, '2010-12-30 11:10:30', 13, 1, 0, 1, 1, 'page', 0),
