(9170935561, '男士钱包', '男士钱包', '', '<p>深色格子钱包，男士专用，休闲！凸显男士的帅气和大方！钱包功能很多，可装多张行卡，多种纸币、零钱！</p><p><span class=\\"Apple-style-span\\" style=\\"font-family: Arial,Helvetica,sans-serif; font-size: 12px; color: rgb(102, 102, 102); line-height: 28px;\\"><b><p style=\\"margin: 0.5em 0px 1em; padding: 0px; line-height: 1.5em;\\">品牌:DIDO</p><p style=\\"margin: 0.5em 0px 1em; padding: 0px; line-height: 1.5em;\\"><br></p><p style=\\"margin: 0.5em 0px 1em; padding: 0px; line-height: 1.5em;\\">DIDO是一个原创设计工作室，创始人分别毕业于清华大学美术学院工艺美术系，北京舞蹈学院艺术设计系舞美设计专业，以及中央美术学院版画系。</p><p style=\\"margin: 0.5em 0px 1em; padding: 0px; line-height: 1.5em;\\">理念:”做自己喜欢的事情，做最棒的自己。”</p><p style=\\"margin: 0.5em 0px 1em; padding: 0px; line-height: 1.5em;\\">主打产品：时尚“环”保包</p><p style=\\"margin: 0.5em 0px 1em; padding: 0px; line-height: 1.5em;\\">风格：最前沿的概念设计+环保理念+优良做工=D1DO“环”保包</p></b></span></p>', 0, 0, 139, 0, 0, '尼龙+填充物', '灰褐色', 18.5, 10, 0, NULL, 0, 0, '', 1, 'font/9170935561.jpg', 'BFOI', 0, 65, '2010-12-07 16:09:15', 0, '2010-12-27 14:05:00', NULL, NULL, NULL, 77, 0, 0, 0, 1, NULL, NULL, 0),
