(9171139545, '变色杯 ', '', '', '<p>杯子表面有一层黑色感温膜，倒入热水后可以感温变色，是个很好的送礼佳品，价格适中，图案多样。不管买给自己或是别人，都很不错！很新奇！</p><p><span class=\\"Apple-style-span\\" style=\\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: rgb(102, 102, 102); line-height: 28px; \\" mce_fixed=\\"1\\"><b><p style=\\"margin-top: 0.5em; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 1.5em; \\">品牌:DIDO</p><p style=\\"margin-top: 0.5em; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 1.5em; \\"></p><p style=\\"margin-top: 0.5em; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 1.5em; \\">DIDO是一个原创设计工作室，创始人分别毕业于清华大学美术学院工艺美术系，北京舞蹈学院艺术设计系舞美设计专业，以及中央美术学院版画系。</p><p style=\\"margin-top: 0.5em; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 1.5em; \\">理念:”做自己喜欢的事情，做最棒的自己。”</p><p style=\\"margin-top: 0.5em; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 1.5em; \\">主打产品：时尚“环”保包</p><p style=\\"margin-top: 0.5em; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 1.5em; \\">风格：最前沿的概念设计+环保理念+优良做工=D1DO“环”保包</p></b></span></p><p><br></p>', 0, 0, 69, 0, 0, '材质为玻璃', '彩色', 9, 8, 0, NULL, 0, 0, '', 1, 'font/9171139545.jpg', 'DRCH', 0, 65, '2010-12-07 16:43:15', 0, '2010-12-22 17:52:10', NULL, NULL, NULL, 88, 0, 0, 1, 1, NULL, NULL, 0),
