(9171281659, '棉花兔（红）', '圣诞促销', '', '<p><b>面料 摇粒绒、羊羔绒，\n</b></p><p><b>填充 珍珠棉\n</b></p><p><b>规格 左右长40cm，上下高50cm（含翅膀），底厚度30cm\n</b></p><p><b>物种 DNA尚不明确的火星系物种 </b></p><p><b>\n颜色 红色/粉色</b></p><p><b></b></p><p><b>\n	<img alt=\\"f585ec35e218a35975540767f774ca13_3_660_660.jpg\\" name=\\"f585ec35e218a35975540767f774ca13_3_660_660.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101220/photo_5876378557467ea17aa3ad115c192d76.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101220/photo_5876378557467ea17aa3ad115c192d76.jpg\\">\n</b></p><p><b></b></p><p><b>\n	<img alt=\\"62e59a661cf296d58caa1c42ea8efdf7_3_660_660.jpg\\" name=\\"62e59a661cf296d58caa1c42ea8efdf7_3_660_660.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101220/photo_0ae2cefc2a8cd9e3c6c3a2dd9e9ec93b.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101220/photo_0ae2cefc2a8cd9e3c6c3a2dd9e9ec93b.jpg\\">\n</b></p><b>\n<br></b><p></p><p></p><p><b>有翅膀的可以是鸟儿，可以是天使，还可以是一只造型怪异的兔子——棉花头的棉花兔就是一只长着翅膀的兔子。她可能来自于水星，也可能来自于火星，总之，它到底来自于哪里一直是个谜。但是，这丝毫不妨碍他的超级卡哇伊。造型可爱！颜色艳丽！摸起来手感很好！抱在怀里也很舒服！适合当靠垫或者抱枕哦！</b></p><p><b></b></p><p><b>\n	<img alt=\\"43b724433c4ebc158c7a8f3b71ac86e1_3_660_660.jpg\\" name=\\"43b724433c4ebc158c7a8f3b71ac86e1_3_660_660.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101220/photo_e39bf9b2af6c0f8e360b36f17beea178.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101220/photo_e39bf9b2af6c0f8e360b36f17beea178.jpg\\">\n</b></p><b><br></b><p></p>', 0, 0, 129, 0, 0, '材质为毛绒，填充物为pp棉', '红', 15.5, 54, 50, NULL, 0, 0, '', 1, 'font/9171281659.jpg', 'FSCU', 0, 42, '2010-12-07 17:06:56', 0, '2010-12-21 11:33:48', NULL, '2010-12-21 11:33:48', '2010-12-15 18:39:17', 191, 0, 0, 0, 1, NULL, NULL, 0),
(9171287458, '无敌熊猫手机贴-百睡款', '', '', '可以贴在车上、笔记本电脑上、音响上、遥控器上等所有可以想到的地方熊猫都可以无限出没！贴纸外覆膜了可以防水呦。另外还有7款熊猫贴纸可以选择呢！\n\nPandaQueen品牌于2006年创立于北京。熊猫PandaQueen是一只生活在都市中的“青年小熊猫”，日出而做，日落而息。身为国宝的“它”钟情艺术、热爱生活、喜欢旅游、执着于生活中的点滴快乐。\n\n ', 0, 0, 12, 0, 0, '纸质类', '黑色、浅粉色', 12, 10, 0, NULL, 0, 0, '', 1, 'font/9171287458.jpg', 'EOTI', 0, 53, '2010-12-07 17:07:54', 0, '2010-12-10 13:21:48', NULL, NULL, NULL, 78, 0, 0, 0, 1, NULL, NULL, 0),
