(9179964758, '玩偶之趴趴狸', '圣诞促销', '', '<p>面料 棉绒布料\n</p><p>填充 填充弹力棉\n</p><p>规格 15CM左右，安全环保，手感灰常好。\n</p><p>物种 一睡不醒的小狐狸</p><p></p><p>\n	<img alt=\\"阿狸趴趴狸09.jpg\\" name=\\"阿狸趴趴狸09.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101220/photo_72b376dcedcc48592ff8e2d25d3c4b49.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101220/photo_72b376dcedcc48592ff8e2d25d3c4b49.jpg\\">\n</p>\n<p>\n	<img alt=\\"阿狸趴趴狸03.jpg\\" name=\\"阿狸趴趴狸03.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101220/photo_17515cc316ee1b7b98dbd6e14bababfd.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101220/photo_17515cc316ee1b7b98dbd6e14bababfd.jpg\\">\n</p>\n<p>\n	<img alt=\\"阿狸趴趴狸05.jpg\\" name=\\"阿狸趴趴狸05.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101220/photo_37712b5e5d9bdacdace36bbad09540c8.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101220/photo_37712b5e5d9bdacdace36bbad09540c8.jpg\\">\n</p>\n<p>\n	<img alt=\\"阿狸趴趴狸02.jpg\\" name=\\"阿狸趴趴狸02.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101220/photo_c8b971c77c4c4d75677e82d9fce44646.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101220/photo_c8b971c77c4c4d75677e82d9fce44646.jpg\\">\n</p>\n<p><b>趴趴狸其实是我们的一个梦想——我们都希望在某个阴霾的清晨，或者安静慵懒的午后，能静悄悄懒散散的趴上一会儿，睡上一觉。趴趴狸又像是我们身边的小宠物，不管什么时间和地点，总是赖在自己的腿上！\n恬静、温馨、这样就能感受到我们人类并不孤独！</b></p><p><b></b></p><p><b>\n	<img alt=\\"阿狸趴趴狸10.jpg\\" name=\\"阿狸趴趴狸10.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101220/photo_3bc7c0001711d9285913c92e2e188415.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101220/photo_3bc7c0001711d9285913c92e2e188415.jpg\\">\n</b></p><b><p>\n	<img alt=\\"阿狸趴趴狸07.jpg\\" name=\\"阿狸趴趴狸07.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101220/photo_69bff4b2b057aa4e514f876f01a779ba.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101220/photo_69bff4b2b057aa4e514f876f01a779ba.jpg\\">\n</p>\n<p>\n	<img alt=\\"阿狸趴趴狸11.jpg\\" name=\\"阿狸趴趴狸11.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101220/photo_c75355ca56e8d3cc7162878d2623b495.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101220/photo_c75355c