(9194835064, '大头兔大', '圣诞促销', '', '<p>【品牌】：关福来\n</p><p>【规格】：均码\n</p><p>【材质】：优质羊羔绒\n</p><p>【洗涤说明】：最好手洗，偶尔机洗请加防护袋轻柔洗涤</p><p>\n【颜色】：米白色</p><p></p><p>\n	<img alt=\\"小美美兔2.jpg\\" name=\\"小美美兔2.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101210/photo_c241cc564491ec6f05f2640acc0e09b2.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101210/photo_c241cc564491ec6f05f2640acc0e09b2.jpg\\">\n</p>\n<br><p></p><p>大头大头，下雨不愁，人有雨伞，我有大头……可是，你能舍得这么可爱的小家伙在外边淋雨受罪吗？大头兔把大头的可爱特点发挥到了极致。舒适柔软的材质，让你无论什么时候都想把她拥入怀中。牵牵他的小手，摸摸她的大头，一切的忧愁就烟消云散了。</p>', 0, 0, 150, 0, 0, '材质为毛绒，填充物为pp棉', '白色', 8.5, 14, 36, NULL, 0, 0, '', 1, 'font/9194835064.jpg', 'FSCU', 0, 45, '2010-12-10 10:32:30', 0, '2011-01-26 17:03:35', NULL, NULL, NULL, 114, 0, 0, 1, 1, NULL, NULL, 0),
