(9120762991, '天使之翼创意围巾', '', '', '<p><span mce_style=\\"color: #ff0000;\\" style=\\"color: rgb(255, 0, 0);\\"><b>如果您购买情侣款黑色白色两条围巾，请联系我们的客户人员为您统一修改价格</b></span><br></p><p>Banbank2011年新年重磅出击，精心设计了一款非常具有创意的围巾。兼具造型和保暖两重功效。黑色的毛绒能够营造出天使翅膀的质感，酷感的黑色又能发挥魔鬼般神秘的气质。</p><p><br></p><p>\n	<img alt=\\"IMG_3343.jpg\\" name=\\"IMG_3343.jpg\\" mce_src=\\"http://imp.100jia.cc/s/watermark/110105/1b43be776f8199a184966cdc318f10e6_rb.jpg\\" src=\\"http://imp.100jia.cc/s/watermark/110105/1b43be776f8199a184966cdc318f10e6_rb.jpg\\">\n</p><p>\n<br></p><p><br></p><p>围巾可以采用多种造型，冬天的街头，你必将成为众人瞩目的焦点。回头率高达200%。敢佩戴此款围巾的人物，一定有着卓尔不凡的气质和勇气。</p><p><br></p><p><br></p><p><br></p>\n<p>\n	<img alt=\\"IMG_3340.jpg\\" name=\\"IMG_3340.jpg\\" mce_src=\\"http://imp.100jia.cc/s/watermark/110105/4162dfcd38df882ab52a6eb6d0ccdef9_rb.jpg\\" src=\\"http://imp.100jia.cc/s/watermark/110105/4162dfcd38df882ab52a6eb6d0ccdef9_rb.jpg\\">\n</p>\n<p>\n	<img alt=\\"IMG_3343.jpg\\" name=\\"IMG_3343.jpg\\" mce_src=\\"http://imp.100jia.cc/s/watermark/110105/1b43be776f8199a184966cdc318f10e6_rb.jpg\\" src=\\"http://imp.100jia.cc/s/watermark/110105/1b43be776f8199a184966cdc318f10e6_rb.jpg\\">\n</p>\n<p>\n	<img alt=\\"IMG_3344.jpg\\" name=\\"IMG_3344.jpg\\" mce_src=\\"http://imp.100jia.cc/s/watermark/110105/10e6b168391a9187d293f6661db2752e_rb.jpg\\" src=\\"http://imp.100jia.cc/s/watermark/110105/10e6b168391a9187d293f6661db2752e_rb.jpg\\">\n</p>\n<p>\n	<img alt=\\"IMG_3349.jpg\\" name=\\"IMG_3349.jpg\\" mce_src=\\"http://imp.100jia.cc/s/watermark/110105/46a2aa7c483627aab47417dc72048c7e_rb.jpg\\" src=\\"http://imp.100jia.cc/s/watermark/110105/46a2aa7c483627aab47417dc72048c7e_rb.jpg\\">\n</p>\n<p>\n	<img alt=\\"IMG_3348.jpg\\" name=\\"IMG_3348.jpg\\" mce_src=\\"http://imp.100jia.cc/s/watermark/110105/143021852ad70767111e8f18386a2c9d_rb.jpg\\" src=\\"http://imp.100jia.cc/s/watermark/110105/143021852ad70767111e8f18386a2c9d_rb.jpg\\">\n</p>\n\n<p>\n	<img alt=\\"IMG_3342.jpg\\" name=\\"IMG_3342.jpg\\" mce_src=\\"http://imp.100jia.cc/s/waterma