(9140710131, '糖果色浣熊（蓝）', '圣诞促销', '', '<p>填充 优质珍珠棉 </p><p>\n规格 身高34厘米，打开尾巴是53厘米哦 <p>\n	<img alt=\\"lan!!35698313.jpg\\" name=\\"lan!!35698313.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101215/photo_cfb26a1d6f11f3a29060ed3f1d00cdf1.jpg\\" src=\\"http://imp.100jia.cc/s/101215/photo_cfb26a1d6f11f3a29060ed3f1d00cdf1.jpg\\">\n</p>\n</p><p>\n物种 宇宙无敌小浣熊，完美演绎浪漫迷人 \n</p><p>颜色 八种颜色组合（注意：拍下时请务必选择好颜色）\n</p><p>包装 透明塑料袋外加非常结实的纸箱，防潮防压，保证娃娃完美到达您的手中\n</p><p>认证 产品通过国家质量技术监督局质检认证 </p><p>\n标准 GB/T 9832--2007</p><p><br></p><p>\n	<img alt=\\"lan!!35698313.jpg\\" name=\\"lan!!35698313.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101215/photo_cfb26a1d6f11f3a29060ed3f1d00cdf1.jpg\\" src=\\"http://imp.100jia.cc/s/101215/photo_cfb26a1d6f11f3a29060ed3f1d00cdf1.jpg\\">\n</p>\n<p>\n	<img alt=\\"lan35698313.jpg\\" name=\\"lan35698313.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101215/photo_e3413c53ec864c4ac1970ac1de2763a7.jpg\\" src=\\"http://imp.100jia.cc/s/101215/photo_e3413c53ec864c4ac1970ac1de2763a7.jpg\\">\n</p><p>\n<br></p><p><br></p><p>\n\n糖果色的浣熊，能把人带进一个童话的色彩世界，不论你中意什么颜色，总有一个适合你。不仅如此，这款玩偶还是一个非常有创意的灵活玩偶，他的眼睛是可以随意摆动的，不管是对眼，斜眼，都能随心摆布。另外，大大的尾巴也是旋转变换。\n可爱又兼具创意的玩偶，绝对是节日的首选礼品；想想朋友整天抱着你送的娃娃，够甜蜜了吧！！</p>', 0, 0, 158, 0, 0, '', '', 0, 0, 0, NULL, 0, 0, '', 1, 'font/9140710131.jpg', 'FSCU', 0, 84, '2010-12-15 17:58:21', 0, '2010-12-21 11:52:22', NULL, NULL, NULL, 72, 0, 0, 0, 1, NULL, NULL, 0),
