(9157675175, '圣诞（miu）限量版抱枕（特大号）', '圣诞促销', '', '<p><span mce_name=\\"strong\\" mce_style=\\"font-weight: bold;\\" style=\\"font-weight: bold;\\" class=\\"Apple-style-span\\">miu并非意见纯粹的万物或摆设，“抱拦感受”是首要关注的。\n我们想设计一直比常规更体贴的抱枕，希望能得到使用者的一见钟情。</span><span class=\\"Apple-style-span\\" style=\\"font-weight: bold; \\" mce_style=\\"font-weight: bold; \\" mce_name=\\"strong\\" mce_fixed=\\"1\\">抽象猫外形不仅是改变一贯几何简单的无感情形状，更重要是为更好的配合使用者抱揽的姿势。\n我们深信优质的产品才能承托出对品质生活的追求。\n除了一副圆润饱满的肥猫身躯，事实上miu外形曲线的每一个弧度皆是为你的怀抱而设计。</span><span class=\\"Apple-style-span\\" style=\\"font-weight: bold; \\" mce_style=\\"font-weight: bold; \\" mce_name=\\"strong\\" mce_fixed=\\"1\\">特选的优质布料，每只miu都有缝制布料成分与水洗标签，使敏感的你用德舒身。安全的填充物料，独立miu芯安全看得见，洁白的珍珠棉弹性充足不易变形，用的安心。</span></p><p></p><p>\n	<img alt=\\"miu圣诞抱枕01.jpg\\" name=\\"miu圣诞抱枕01.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101223/photo_0a2726d93c7d940f2b0d7f6a1712d178.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101223/photo_0a2726d93c7d940f2b0d7f6a1712d178.jpg\\">\n</p>\n<p>\n	<img alt=\\"miu圣诞抱枕02.jpg\\" name=\\"miu圣诞抱枕02.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101223/photo_27acfcc288f3f70a8b5bcce42c641c98.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101223/photo_27acfcc288f3f70a8b5bcce42c641c98.jpg\\">\n</p>\n<p>\n	<img alt=\\"miu圣诞抱枕03.jpg\\" name=\\"miu圣诞抱枕03.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101223/photo_03d590ca9eaf7b0379327336eb533ae6.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101223/photo_03d590ca9eaf7b0379327336eb533ae6.jpg\\">\n</p>\n<p>\n	<img alt=\\"miu圣诞抱枕04.jpg\\" name=\\"miu圣诞抱枕04.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101223/photo_8db27134e0e344d58fefaf0f8e7d9d7b.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101223/photo_8db27134e0e344d58fefaf0f8e7d9d7b.jpg\\">\n</p>\n<br><p></p>', 0, 0, 299, 0, 0, '', '', 0, 0, 0, NULL, 1, 0, '', 1, 'font/9157675175.jpg', 'DEJQ', 0, 94, '2010-12-17 17:05:51', 0, '2011-01-07 17:20:15', NULL, '2011-01-07 17:20:15', NULL, 389, 0, 0, 0, 1, NULL, NULL, 0),
(9181852132, '环保年历', '胖兔子,粥粥,月历,挂历,年历,白色,纸制,环保,创意', '胖兔子粥粥环保年历，每月都有好心情。', '<p>胖兔子粥粥环保年历，每月都有好心情。  </p><p></p><p>\n	<img alt=\\"挂历广告展示 主图.JPG\\" name=\\"挂历广告展示 主图.JPG\\" mce_src=\\"http://imp.100jia.cc/s/101220/photo_eefc6d6234aad7d512713894f3403e42.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101220/photo_eefc6d6234aad7d512713894f3403e42.jpg\\">\n</p>\n<p>胖兔子粥粥： 2005年开始画涂鸦日记博客。深受广大人民群众尤其是女性读者的喜爱。 2006年参加MSN SPACES大赛并获得冠军，奖品是一辆红色的POLO小车。 2007年国内首款环保袋--胖兔子粥粥环保袋上市。</p><p></p><p>\n	<img alt=\\"挂历广告展示.jpg\\" name=\\"挂历广告展示.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101220/photo_ff1e3948af5a5a4e79c9713721fc35f8.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101220/photo_ff1e3948af5a5a4e79c9713721fc35f8.jpg\\">\n</p>\n<br><p></p><p>年底，粥粥因其在环保方面的突出影响，在钓鱼台国宾馆贵宾厅得到国家领导人接见，并被评为《中国和乐家庭榜样》，与体育明星姚明、李小双同列。 2008年《依然饭特稀》在大米粥的期盼中问世，卖的还行。 2009年服务过世博会、绿色和平、万事达卡、固铂轮胎、百事可乐等好多听起来很高级的单位…… 09年末总结是：一言难尽、一如既往、一塌糊涂、一笑而过。2010年会咋样呢?等着瞧吧…… 2010年再创搞笑作品《依然饭特稀2：不能说的秘密》，再度引起“粥粥热”。</p>\n<p><br></p>', 0, 0, 25, 0, 0, '环保白卡纸', '乳白 蓝色', 0, 0, 0, NULL, 0, 0, '件', -1, 'font/9181852132.jpg', 'ECAG', 0, 95, '2010-12-20 12:15:21', 0, '2011-05-09 15:53:35', NULL, '2010-12-21 12:39:44', NULL, 339, 0, 0, 0, 1, NULL, NULL, 0);
