(9182040664, 'como兔男（大）', '情人节礼物', '', '<p><b>面料 毛绒\n</b></p><p><b>填充 pp棉 </b></p><p><b>\n规格 身高47厘米\n</b></p><p><b>物种 出双入对柔软无敌的大兔子</b></p><p><b> \n颜色 白色和粉色\n\n</b></p><p></p><p>\n	<img alt=\\"kiroro兔子.jpg\\" name=\\"kiroro兔子.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101220/photo_8fa19c5fcc73715db8f0aef6cb8380f5.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101220/photo_8fa19c5fcc73715db8f0aef6cb8380f5.jpg\\">\n</p>\n<p></p><p>\n	<img alt=\\"kiroro兔子7.jpg\\" name=\\"kiroro兔子7.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101220/photo_84036343319a7e5819201dc60b76ee63.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101220/photo_84036343319a7e5819201dc60b76ee63.jpg\\">\n</p><p>\n<b>COMO兔是一对出双入对的玩偶佳侣。一只是白色，穿着可爱的碎花小裙子；一只是粉色，穿着帅气十足的背带裤。他们相亲相爱，形影不离。兔子第一次有了形影相随的爱侣。</b></p><p></p><p>\n	<img alt=\\"kiroro兔子3.jpg\\" name=\\"kiroro兔子3.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101220/photo_32422125cf5f49a0d660b07a727a4ad1.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101220/photo_32422125cf5f49a0d660b07a727a4ad1.jpg\\">\n</p>\n<p>\n	<img alt=\\"kiroro兔子2.jpg\\" name=\\"kiroro兔子2.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101220/photo_20776bcd007ade484543023ecd0c07e2.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101220/photo_20776bcd007ade484543023ecd0c07e2.jpg\\">\n</p>\n<p>\n	<img alt=\\"kiroro兔子4.jpg\\" name=\\"kiroro兔子4.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101220/photo_13d8dad71430d8f9843072570ce22b42.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101220/photo_13d8dad71430d8f9843072570ce22b42.jpg\\">\n</p><p>\n<br></p><p></p><p><b>所以。如果你只带一只回家，恐怕他会寂寞。建议两只都买回去吧。让没有你陪在身边的时候，他们一样快乐满足。</b></p><p><b></b></p><p><b>\n	<img alt=\\"kiroro兔子合影.jpg\\" name=\\"kiroro兔子合影.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101220/photo_8e107ee3a6a75c8011b31b1c06591727.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101220/photo_8e107ee3a6a75c8011b31b1c06591727.jpg\\">\n</b></p><b><br></b><p></p><p></p>', 0, 0, 128, 0, 0, '材质为毛绒，填充物为pp棉', '白色', 0, 0, 0, NULL