(9191859486, '圣诞树钱包', '', '', '<p>圣诞节即将到来。趁着节日好时机，把火红的圣诞红和标志性的圣诞树一起浓缩在钱包。DIDO的圣诞树钱包就能实现这个愿望。把圣诞节装进包包里，全年都有好运气。</p><p>品牌:DIDO</p><p><p>DIDO是一个原创设计工作室，创始人分别毕业于清华大学美术学院工艺美术系，北京舞蹈学院艺术设计系舞美设计专业，以及中央美术学院版画系。</p><p>理念:”做自己喜欢的事情，做最棒的自己。”</p><p>主打产品：时尚“环”保包</p><p>风格：最前沿的概念设计+环保理念+优良做工=D1DO“环”保包</p></p><p><br></p><p>\n	<img alt=\\"DIDO圣诞树钱包98元06.jpg\\" name=\\"DIDO圣诞树钱包98元06.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101221/photo_45aae1fc8746ef4f353580d2b6d93b26.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101221/photo_45aae1fc8746ef4f353580d2b6d93b26.jpg\\">\n</p>\n<p>\n	<img alt=\\"DIDO圣诞树钱包98元05.jpg\\" name=\\"DIDO圣诞树钱包98元05.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101221/photo_0baec44ea78f4445bd275620b47e0f81.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101221/photo_0baec44ea78f4445bd275620b47e0f81.jpg\\">\n</p>\n<p>\n	<img alt=\\"DIDO圣诞树钱包98元07.jpg\\" name=\\"DIDO圣诞树钱包98元07.jpg\\" mce_src=\\"http://imp.100jia.cc/s/101221/photo_56063f3dfa06637c9472b43f15999b2d.jpg\\" _moz_dirty=\\"\\" src=\\"http://imp.100jia.cc/s/101221/photo_56063f3dfa06637c9472b43f15999b2d.jpg\\">\n</p><p>\n<br></p><p><br></p><p></p><p><span mce_name=\\"strong\\" mce_style=\\"font-weight: bold;\\" style=\\"font-weight: bold;\\" class=\\"Apple-style-span\\"></span></p><p><span mce_name=\\"strong\\" mce_style=\\"font-weight: bold;\\" style=\\"font-weight: bold;\\" class=\\"Apple-style-span\\"></span></p><p><span mce_name=\\"strong\\" mce_style=\\"font-weight: bold;\\" style=\\"font-weight: bold;\\" class=\\"Apple-style-span\\"></span></p><p><span mce_name=\\"strong\\" mce_style=\\"font-weight: bold;\\" style=\\"font-weight: bold;\\" class=\\"Apple-style-span\\"></span></p><p><span mce_name=\\"strong\\" mce_style=\\"font-weight: bold;\\" style=\\"font-weight: bold;\\" class=\\"Apple-style-span\\"></span></p><p><span mce_name=\\"strong\\" mce_style=\\"font-weight: bold;\\" style=\\"font-weight: bold;\\" class=\\"Apple-style-span\\"></span></p><p><span mce_name=\\"strong\\" mce_style=\\"fo