(9137446332, '现货发售！！《宫锁心玉》系列漫画周边套装', '宫', '', '<p><span mce_style=\\"color: #ff0000;\\" style=\\"color: rgb(255, 0, 0);\\"><b>宫画集的预购活动出乎意料的火爆， \nwww.100jia.cc最新消息是：预购人数已超过500名，赠送签名先到先得的名额已满。</b></span></p><p><span mce_style=\\"color: #ff0000;\\" style=\\"color: rgb(255, 0, 0);\\"><b>但是网站流量飙升预购人数越来越多，我们将和设计师炎炎联\n系，争取到更多的签名名额进行抽奖，请大家持续关注。</b></span></p><p><span mce_style=\\"color: #ff0000;\\" style=\\"color: rgb(255, 0, 0);\\"><b>在支付和预购方面有问题的，可以直接拨打400-650-8536咨询</b></span></p><p><br></p><p>预售产品：</p><p>《宫》系列漫画周边套装</p><p>画集一册</p><p>明信片一套（10张）</p><p>书签一套（6张）</p><p>预售价格：99元</p><p><span mce_style=\\"color: #ff0000;\\" style=\\"color: rgb(255, 0, 0);\\"><b><u>发货时间：由于明星签名活动的档期安排问题，我们将推迟至4月15日发货</u></b></span></p><p><br></p><p><b>支付方式：</b></p><p><br>1、您可以选择在我们的网站上通过支付宝进行支付；</p><p>2、也可以选择在网上先拍下产品，产生订单，然后将款项支付到如下账户：</p><p><b>开户银行：华夏银行东四支行</b></p><p><b>单位名称：北京九一格国际文化有限公司</b></p><p><b>银行帐号：4032200001819900054634</b></p><p><br><b>支付完成后，请在通过客服向我们说明您已经支付的订单号码、汇款姓名和联系方式，我们将在月底为您发货。</b></p><p>\n	<img alt=\\"宫 周边 效果图 5.jpg\\" name=\\"宫 周边 效果图 5.jpg\\" mce_src=\\"http://imp.100jia.cc/s/watermark/110306/981c10a0508cb63b43510c279c47e0bd_rb.jpg\\" src=\\"http://imp.100jia.cc/s/watermark/110306/981c10a0508cb63b43510c279c47e0bd_rb.jpg\\">\n</p><p><br></p><p>\n《宫》</p><p>《宫锁心玉》原名《宫》，由金牌编剧于正创作，和湖南台联办的首部港台内地联手的清朝穿越剧。于2010年7月10日在横店开机拍摄，这是距于正的《大清后宫》之后的又一部讲述清朝历史故事的大戏。此剧以清朝最具话题的“九子夺嫡”为题材，剧中杨幂扮演一个现代少女洛晴川，穿越到清朝，经历古代的宫廷生活，经历一番“宫心计”和男女情爱之后，回到现实中，更加懂得珍惜当下。《宫锁心玉》于2011年1月31日开始在湖南卫视首播。剧组将在2011年2月26日在湖南卫视《快乐大本营》亮相。</p><p>The GongSuo heart jade \\"formerly the palace\\", by gold writers in the positive creation, and hunan Taiwan joint first exhibition of qing dynasty Taiwan mainland wear shaoxing opera. In 2010 July 10 in hengdian boot filming, this is the distance from the qing succedent houses \\"is the one after another tells the story of qing dynasty history dramas. Focusing on the qing dynasty the most topic \\"nine son took the primogeniture\\" as subject matter, play a modern girl luo Yang mi, qingchuan, through to the qing ancient palace life experience, and experience a \\"palace deceit\\" and men and women love after, came back to reality, will cherish today. The GongSuo heart jade \\"in 2011 January 31 start in hunan satellite TV network. Cast in 2011 February 26 in hunan satellite TV \\"happy camp\\" appearance.</p><p><br></p><p>《宫》画集系列作品及其周边均由制片方官方授权</p><p>北京九一格国际文化有限公司版权所有请勿翻印 违者必究</p><p>The palace \\"album series works and its surrounding all by the producers official authorization<br>Beijing 9IBOX international cultural Co., LTD. All rights reserved. Please do not re-print <br></p>', 0, 0, 99, 0, 0, '纸', '粉色 白色', 29, 30, 8, NULL, 1, 0, '', 1, 'font/9137446332.jpg', 'ECAG', 0, 79, '2011-03-06 09:21:03', 0, '2011-05-23 10:42:42', NULL, '2011-05-23 10:42:42', NULL, 19775, 0, 127, 0, 1, NULL, NULL, 0);
