(9108624087, '预售《宫锁心玉》系列人物抱枕——八阿哥（无芯）', '宫锁心玉', '', '<p><!--[if gte mso 9]><xml> <w:WordDocument> <w:View>Normal</w:View> <w:Zoom>0</w:Zoom> <w:PunctuationKerning /> <w:DrawingGridVerticalSpacing>7.8 磅</w:DrawingGridVerticalSpacing> <w:DisplayHorizontalDrawingGridEvery>0</w:DisplayHorizontalDrawingGridEvery> <w:DisplayVerticalDrawingGridEvery>2</w:DisplayVerticalDrawingGridEvery> <w:ValidateAgainstSchemas /> <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid> <w:IgnoreMixedContent>false</w:IgnoreMixedContent> <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText> <w:Compatibility> <w:SpaceForUL /> <w:BalanceSingleByteDoubleByteWidth /> <w:DoNotLeaveBackslashAlone /> <w:ULTrailSpace /> <w:DoNotExpandShiftReturn /> <w:AdjustLineHeightInTable /> <w:BreakWrappedTables /> <w:SnapToGridInCell /> <w:WrapTextWithPunct /> <w:UseAsianBreakRules /> <w:DontGrowAutofit /> <w:UseFELayout /> </w:Compatibility> <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel> </w:WordDocument> </xml><![endif]--><!--[if gte mso 9]><xml> <w:LatentStyles DefLockedState=\\"false\\" LatentStyleCount=\\"156\\"> </w:LatentStyles> </xml><![endif]--><!--[if gte mso 10]> <mce:style><!   /* Style Definitions */  table.MsoNormalTable 	{mso-style-name:普通表格; 	mso-tstyle-rowband-size:0; 	mso-tstyle-colband-size:0; 	mso-style-noshow:yes; 	mso-style-parent:\\"\\"; 	mso-padding-alt:0cm 5.4pt 0cm 5.4pt; 	mso-para-margin:0cm; 	mso-para-margin-bottom:.0001pt; 	mso-pagination:widow-orphan; 	font-size:10.0pt; 	font-family:\\"Times New Roman\\"; 	mso-fareast-font-family:\\"Times New Roman\\"; 	mso-ansi-language:#0400; 	mso-fareast-language:#0400; 	mso-bidi-language:#0400;} --> <!--[endif]--></p>\n<p class=\\"MsoNormal\\" style=\\"text-indent: 15.75pt; line-height: 150%;\\" mce_style=\\"text-indent: 15.75pt; line-height: 150%;\\"><b>以下为杨幂现场签名的场景</b></p><p class=\\"MsoNormal\\" style=\\"text-indent: 15.75pt; line-height: 150%;\\" mce_style=\\"text-indent: 15.75pt; line-height: 150%;\\"><p>\n	<img alt=\\"IMG_1890_660.jpg\\" name=\\"IMG_1890_660.jpg\\" mce_src=\\"http://imp.100jia.cc/s/watermark/110316/b07fb0a9c8abcab8fcbfeb6f8067854a_rb.jpg\\" src=\\"http://imp.100jia.cc/s/watermark/110316/b07fb0a9c8abcab8fcbfeb6f8067854a_rb.jpg\\">\n</p>\n<p>\n	<img alt=\\"IMG_1892_660.jpg\\" name=\\"IMG_1892_660.jpg\\" mce_src=\\"http://imp.100jia.cc/s/watermark/110316/453e0b683c7fa201f7918dfd6368452e_rb.jpg\\" src=\\"http://imp.100jia.cc/s/watermark/110316/453e0b683c7fa201f7918dfd6368452e_rb.jpg\\">\n</p>\n<br></p><p class=\\"MsoNormal\\" style=\\"text-indent: 15.75pt; line-height: 150%;\\" mce_style=\\"text-indent: 15.75pt; line-height: 150%;\\"><span lang=\\"EN-US\\">品牌：Banbank</span></p>\n<p class=\\"MsoNormal\\" style=\\"text-indent: 15.75pt; line-height: 150%;\\" mce_style=\\"text-indent: 15.75pt; line-height: 150%;\\"><span style=\\"font-family: 宋体;\\" mce_style=\\"font-family: 宋体;\\">介绍：</span><span lang=\\"EN-US\\">Banbank</span><span style=\\"font-family: 宋体;\\" mce_style=\\"font-family: 宋体;\\">年度热播穿越偶像剧《宫锁心玉》的正式合作品牌，获得了制片方的正式授权，为《宫》系列人物打造漫画形象，从时尚文化的角度创新演绎这个动人的故事。</span><span style=\\"font-family: 宋体;\\" mce_style=\\"font-family: 宋体;\\">《宫》</span><span lang=\\"EN-US\\">Q</span><span style=\\"font-family: 宋体;\\" mce_style=\\"font-family: 宋体;\\">版漫画抱枕不仅为《宫》迷们描绘了主角们穿越到现代生活的搞笑故事，更为所有漫画爱好者提供了趣味盎然、生动丰富的形象。温馨的爱情，可爱的人物，为您的生活增添更多笑声和欢乐。</span></p>\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\" mce_style=\\"line-height: 150%;\\"><span lang=\\"EN-US\\"><span>&nbsp;&nbsp; </span></span><span style=\\"font-family: 宋体;\\" mce_style=\\"font-family: 宋体;\\">正当季的可爱抱枕，买回家里，凭添一份浪漫；送给朋友，表达一份心意。高档的纯棉精织帆布，精心的做工，更代表着有品质、有内容的精良生活品味！</span></p>\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\" mce_style=\\"line-height: 150%;\\"><span lang=\\"EN-US\\">&nbsp;<p>\n	<img alt=\\"靠枕 八阿哥 660.jpg\\" name=\\"靠枕 八阿哥 660.jpg\\" mce_src=\\"http://imp.100jia.cc/s/watermark/110314/c4c5b344dd44483b6cf7b9a3a3bc13ff_rb.jpg\\" src=\\"http://imp.100jia.cc/s/watermark/110314/c4c5b344dd44483b6cf7b9a3a3bc13ff_rb.jpg\\">\n</p>\n</span></p>\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\" mce_style=\\"line-height: 150%;\\"><span style=\\"font-size: 12pt; line-height: 150%; font-family: 宋体;\\" mce_style=\\"font-size: 12pt; line-height: 150%; font-family: 宋体;\\">本产品所使用图片和动漫形象，由我国著名的漫画人，动画监制炎炎亲自倾力打造！</span></p>\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\" mce_style=\\"line-height: 150%;\\"><b><span style=\\"font-size: 14pt; line-height: 150%;\\" mce_style=\\"font-size: 14pt; line-height: 150%;\\" lang=\\"EN-US\\">1</span></b><b><span style=\\"font-size: 14pt; line-height: 150%; font-family: 宋体;\\" mce_style=\\"font-size: 14pt; line-height: 150%; font-family: 宋体;\\">、产品材质工艺：</span></b><b></b></p>\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\" mce_style=\\"line-height: 150%;\\"><span lang=\\"EN-US\\"><span>&nbsp;&nbsp; </span></span><span style=\\"font-family: 宋体;\\" mce_style=\\"font-family: 宋体;\\">本产品是国内首创选用天然环保的全棉高档纺织品，堪比高品质服装工艺级高支纯棉精梳面料，无需涂打底胶，天然环保、易保存、易打理；</span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\" mce_style=\\"line-height: 150%;\\"><span style=\\"font-family: 宋体;\\" mce_style=\\"font-family: 宋体;\\">产品理化指标通过国际</span><span lang=\\"EN-US\\">sgs</span><span style=\\"font-family: 宋体;\\" mce_style=\\"font-family: 宋体;\\">检测，达到或超过欧盟权威环保纺织品标准</span><span lang=\\"EN-US\\">oko-texstandard 100</span><span style=\\"font-family: 宋体;\\" mce_style=\\"font-family: 宋体;\\">与国家</span><span lang=\\"EN-US\\">GB18401-2003</span><span style=\\"font-family: 宋体;\\" mce_style=\\"font-family: 宋体;\\">环保强制标准，产品可与人贴身接触，做到真正的环保、无刺激、无异味。</span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\" mce_style=\\"line-height: 150%;\\"><b><span style=\\"font-size: 14pt; line-height: 150%;\\" mce_style=\\"font-size: 14pt; line-height: 150%;\\" lang=\\"EN-US\\">2</span></b><b><span style=\\"font-size: 14pt; line-height: 150%; font-family: 宋体;\\" mce_style=\\"font-size: 14pt; line-height: 150%; font-family: 宋体;\\">、顶级的印染印花工艺——色彩卓越，画面通透</span></b><b></b></p>\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\" mce_style=\\"line-height: 150%;\\"><b><span style=\\"font-size: 9pt; line-height: 150%;\\" mce_style=\\"font-size: 9pt; line-height: 150%;\\" lang=\\"EN-US\\"><span>&nbsp;&nbsp; </span></span></b><span lang=\\"EN-US\\"><span>&nbsp;</span></span><span style=\\"font-family: 宋体;\\" mce_style=\\"font-family: 宋体;\\">本产品印刷工艺采用世界顶级数码影像拍摄和采集设备，全新纺织品数码真彩还原印花技术和设备，可在本产品上实现超高精度印花，并拥有卓越的色彩表现力，并且任何角度无反光，保证画面非凡的穿透力、实现高档环保材质与完美画面的融合！</span><b></b></p>', 0, 0, 99, 0, 0, '帆布材质（无内胆）', '', 42, 42, 0, NULL, 1, 0, '', 1, 'font/9108624087.jpg', 'DEJQ', 0, 79, '2011-03-14 15:04:00', 0, '2011-03-16 11:31:33', NULL, '2011-03-16 11:31:33', NULL, 933, 0, 1, 0, 1, NULL, NULL, 0),
(9108687226, '预售《宫锁心玉》系列人物高档蚕丝抱枕——八阿哥（带芯） ', '宫锁心玉', '', '<p><!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:PunctuationKerning/>\n  <w:DrawingGridVerticalSpacing>7.8 磅</w:DrawingGridVerticalSpacing>\n  <w:DisplayHorizontalDrawingGridEvery>0</w:DisplayHorizontalDrawingGridEvery>\n  <w:DisplayVerticalDrawingGridEvery>2</w:DisplayVerticalDrawingGridEvery>\n  <w:ValidateAgainstSchemas/>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:Compatibility>\n   <w:SpaceForUL/>\n   <w:BalanceSingleByteDoubleByteWidth/>\n   <w:DoNotLeaveBackslashAlone/>\n   <w:ULTrailSpace/>\n   <w:DoNotExpandShiftReturn/>\n   <w:AdjustLineHeightInTable/>\n   <w:BreakWrappedTables/>\n   <w:SnapToGridInCell/>\n   <w:WrapTextWithPunct/>\n   <w:UseAsianBreakRules/>\n   <w:DontGrowAutofit/>\n   <w:UseFELayout/>\n  </w:Compatibility>\n  <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>\n </w:WordDocument>\n</xml><![endif]--><!--[if gte mso 9]><xml>\n <w:LatentStyles DefLockedState=\\"false\\" LatentStyleCount=\\"156\\">\n </w:LatentStyles>\n</xml><![endif]--><!--[if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n	{mso-style-name:普通表格;\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-parent:\\"\\";\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\n	mso-para-margin:0cm;\n	mso-para-margin-bottom:.0001pt;\n	mso-pagination:widow-orphan;\n	font-size:10.0pt;\n	font-family:\\"Times New Roman\\";\n	mso-fareast-font-family:\\"Times New Roman\\";\n	mso-ansi-language:#0400;\n	mso-fareast-language:#0400;\n	mso-bidi-language:#0400;}\n</style>\n<![endif]-->\n\n</p>\n\n<p class=\\"MsoNormal\\" style=\\"text-indent: 15.75pt; line-height: 150%;\\"><span lang=\\"EN-US\\">品牌：Banbank</span><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\"></span></p><p class=\\"MsoNormal\\" style=\\"text-indent: 15.75pt; line-height: 150%;\\"><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">介绍：</span><span lang=\\"EN-US\\">Banbank</span><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">是年度热播穿越偶像剧《宫锁心玉》的正式合作品牌，获得了制片方的正式授权，为《宫》系列人物打造漫画形象，从时尚文化的角度创新演绎这个动人的故事。</span><span lang=\\"EN-US\\"></span><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">《宫》</span><span lang=\\"EN-US\\">Q</span><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">版漫画抱枕不仅为《宫》迷们描绘了主角们穿越到现代生活的搞笑故事，更为所有漫画爱好者提供了趣味盎然、生动丰富的形象。温馨的爱情，可爱的人物，为您的生活增添更多笑声和欢乐。</span><span lang=\\"EN-US\\"></span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><span lang=\\"EN-US\\">   </span><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">正当季的可爱抱枕，买回家里，凭添一份浪漫；送给朋友，表达一份心意。高档的蚕丝品质，精心的做工，更代表着有品质、有内容的精良生活品味！</span>\n<span lang=\\"EN-US\\"></span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><span lang=\\"EN-US\\"> <p>\n	<img alt=\\"靠枕 八阿哥 660.jpg\\" name=\\"靠枕 八阿哥 660.jpg\\" mce_src=\\"http://imp.100jia.cc/s/watermark/110314/c00baea78575ada387ab11d11009e27d_rb.jpg\\" src=\\"http://imp.100jia.cc/s/watermark/110314/c00baea78575ada387ab11d11009e27d_rb.jpg\\">\n</p>\n</span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">本产品所使用图片和动漫形象，由我国著名的漫画人，动画监制炎炎亲自倾力打造！</span><span lang=\\"EN-US\\"></span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><span lang=\\"EN-US\\">1</span><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">、产品材质工艺：</span><span lang=\\"EN-US\\"></span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><span lang=\\"EN-US\\">  <span mce_style=\\"color: #ff0000;\\" style=\\"color: rgb(255, 0, 0);\\"><b> </b></span></span><span mce_style=\\"color: #ff0000;\\" style=\\"color: rgb(255, 0, 0);\\"><b><span lang=\\"EN-US\\">本产品是国内首创</span><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">选用</span><span lang=\\"EN-US\\">100%</span><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">天然蚕丝、绸缎面的高贵光泽、显色鲜艳光亮！</span></b></span><span lang=\\"EN-US\\"></span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">产品理化指标通过国际</span><span lang=\\"EN-US\\">sgs</span><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">检测，达到或超过欧盟权威环保纺织品标准</span><span lang=\\"EN-US\\">oko-texstandard 100</span><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">与国家</span><span lang=\\"EN-US\\">GB18401-2003</span><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">环保强制标准，产品可与人贴身接触，做到真正的环保、无刺激、无异味。</span><span lang=\\"EN-US\\"></span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><span lang=\\"EN-US\\">   </span><span mce_style=\\"color: #ff0000;\\" style=\\"color: rgb(255, 0, 0);\\"><b><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">本产品面料经过纳米后整理加工，具备超高的三防性能（防水、防污、抗污），使产品更加容易打理保存！</span></b></span><span lang=\\"EN-US\\"></span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><span lang=\\"EN-US\\">2</span><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">、顶级的印染印花工艺——色彩卓越，画面通透</span><span lang=\\"EN-US\\"></span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><span lang=\\"EN-US\\">    </span><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">本产品印刷工艺采用世界顶级数码影像拍摄和采集设备，全新纺织品数码真彩还原印花技术和设备，可在本产品上实现超高精度印花，并拥有卓越的色彩表现力，并且任何角度无反光，保证画面非凡的穿透力、实现高档环保材质与完美画面的融合！</span><span lang=\\"EN-US\\"></span></p>\n\n', 0, 0, 328, 0, 0, '高级蚕丝', '', 42, 42, 0, NULL, 0, 0, '', 1, 'font/9108687226.jpg', 'DEJQ', 0, 79, '2011-03-14 15:14:32', 0, '2011-03-14 18:06:25', NULL, NULL, NULL, 119, 0, 0, 0, 1, NULL, NULL, 0),
