yle=\\"font-family: 宋体;\\">天然蚕丝、绸缎面的高贵光泽、显色鲜艳光亮！</span></b><span lang=\\"EN-US\\"></span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">产品理化指标通过国际</span><span lang=\\"EN-US\\">sgs</span><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">检测，达到或超过欧盟权威环保纺织品标准</span><span lang=\\"EN-US\\">oko-texstandard 100</span><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">与国家</span><span lang=\\"EN-US\\">GB18401-2003</span><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">环保强制标准，产品可与人贴身接触，做到真正的环保、无刺激、无异味。</span><span lang=\\"EN-US\\"></span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><span lang=\\"EN-US\\">   </span><span mce_style=\\"color: #ff0000;\\" style=\\"color: rgb(255, 0, 0);\\"><b><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">本产品面料经过纳米后整理加工，具备超高的三防性能（防水、防污、抗污），使产品更加容易打理保存！</span></b></span><span lang=\\"EN-US\\"></span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><span lang=\\"EN-US\\">2</span><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">、顶级的印染印花工艺——色彩卓越，画面通透</span><span lang=\\"EN-US\\"></span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><span lang=\\"EN-US\\">    </span><span mce_style=\\"font-family: 宋体;\\" style=\\"font-family: 宋体;\\">本产品印刷工艺采用世界顶级数码影像拍摄和采集设备，全新纺织品数码真彩还原印花技术和设备，可在本产品上实现超高精度印花，并拥有卓越的色彩表现力，并且任何角度无反光，保证画面非凡的穿透力、实现高档环保材质与完美画面的融合！</span><span lang=\\"EN-US\\"></span></p>\n\n', 0, 0, 328, 0, 0, '高级蚕丝/填充PP棉', '', 42, 42, 0, NULL, 0, 0, '', 1, 'font/9108726019.jpg', 'DEJQ', 0, 79, '2011-03-14 15:21:00', 0, '2011-03-14 18:05:55', NULL, NULL, NULL, 74, 0, 0, 0, 1, NULL, NULL, 0),
(9117351473, '暖瓶系列创意灯饰', '母亲节', '', '<p>金属底座+皮绒布雕刻图案+内衬PVC<p>\n	<img alt=\\"暖壶 01.jpg\\" name=\\"暖壶 01.jpg\\" mce_src=\\"http://imp.100jia.cc/s/watermark/110315/76755f21ec4294757582ca12f22fbdb5_rb.jpg\\" src=\\"http://imp.100jia.cc/s/watermark/110315/76755f21ec4294757582ca12f22fbdb5_rb.jpg\\"><p>\n	<img alt=\\"暖壶 06.jpg\\" name=\\"暖壶 06.jpg\\" mce_src=\\"http://imp.100jia.cc/s/watermark/110315/ff2c0643a0c1c8ae53424fdfe820cec6_rb.jpg\\" src=\\"http://imp.100jia.cc/s/watermark/110315/ff2c0643a0c1c8ae53424fdfe820cec6_rb.jpg\\">\n</p>\n\n</p>\n<p>\n	<img alt=\\"暖壶 02.jpg\\" name=\\"暖壶 02.jpg\\" mce_src=\\"http://imp.100jia.cc/s/watermark/110315/8af3c83527d2f81d9f667ac6219dd6f6_rb.jpg\\" src=\\"http://imp.100jia.cc/s/watermark/110315/8af3c83527d2f81d9f667ac6219dd6f6_rb.jpg\\">\n</p>\n<br mce_bogus=\\"1\\"></p>', 0, 0, 168, 0, 0, '', '', 0, 0, 0, NULL, 0, 0, '', 1, 'font/9117351473.jpg', 'DTVU', 0, 115, '2011-03-15 15:18:34', 0, '2011-04-27 17:14:36', NULL, NULL, NULL, 51, 0, 0, 0, 1, NULL, NULL, 0),
