(9109514833, '《宫锁心玉》系列Q版人物高档蚕丝抱枕--八阿哥（带芯）', '宫锁心玉', '', '<p><span lang=\\"EN-US\\">品牌：Banbank</span></p><p><span lang=\\"EN-US\\"></span><span style=\\"font-family: 宋体;\\">介绍：</span><span lang=\\"EN-US\\">Banbank</span><span style=\\"font-family: 宋体;\\">是年度热播穿越偶像剧《宫锁心玉》的正式合作品牌，获得了制片方的正式授权，为《宫》系列人物打造漫画形象，从时尚文化的角度创新演绎这个动人的故事。</span><span lang=\\"EN-US\\"></span>\n\n</p><p class=\\"MsoNormal\\" style=\\"text-indent: 15.75pt; line-height: 150%;\\"><span style=\\"font-family: 宋体;\\">《宫》</span><span lang=\\"EN-US\\">Q</span><span style=\\"font-family: 宋体;\\">版漫画抱枕不仅为《宫》迷们描绘了主角们穿越到现代生活的搞笑故事，更为所有漫画爱好者提供了趣味盎然、生动丰富的形象。温馨的爱情，可爱的人物，为您的生活增添更多笑声和欢乐。</span><span lang=\\"EN-US\\"></span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><span lang=\\"EN-US\\">   </span><span style=\\"font-family: 宋体;\\">正当季的可爱抱枕，买回家里，凭</span><span style=\\"font-family: 宋体;\\">添一份浪漫；送给朋友，表达一份心意。高档的蚕丝材质，精心的做工，更代表着有品质、有内容的精良生活品味！</span></p><p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><span style=\\"font-family: 宋体;\\">本产品所使用图片和动漫形象，由我国著名的漫画人，动画监制炎炎亲自倾力打造！</span></p><p><span style=\\"font-family: 宋体;\\"></span><span lang=\\"EN-US\\"></span></p><p>\n\n<span lang=\\"EN-US\\"> <p>\n	<img alt=\\"靠枕 卡通供养 660.jpg\\" name=\\"靠枕 卡通供养 660.jpg\\" mce_src=\\"http://imp.100jia.cc/s/watermark/110314/8173517ae6294a1b65f9fbf5482f539e_rb.jpg\\" src=\\"http://imp.100jia.cc/s/watermark/110314/8173517ae6294a1b65f9fbf5482f539e_rb.jpg\\">\n</p>\n </span><br></p><p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><b><span lang=\\"EN-US\\">1</span><span style=\\"font-family: 宋体;\\">、产品材质工艺：</span></b><span lang=\\"EN-US\\"></span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><span lang=\\"EN-US\\">   </span><span style=\\"font-family: 宋体;\\">本产品是国内首创选用天然环保的全棉高档纺织品，堪比高品质服装工艺级高支纯棉精梳面料，无需涂打底胶，天然环保、易保存、易打理；</span><span lang=\\"EN-US\\"></span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><span lang=\\"EN-US\\">  <span style=\\"color: rgb(255, 0, 0);\\"> </span></span><span style=\\"color: rgb(255, 0, 0);\\"><b><span style=\\"font-family: 宋体;\\">本产品还选用</span><span lang=\\"EN-US\\">100%</span><span style=\\"font-family: 宋体;\\">天然蚕丝、绸缎面的高贵光泽、显色鲜艳光亮！</span></b></span><span lang=\\"EN-US\\"></span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><span style=\\"font-family: 宋体;\\">产品理化指标通过国际</span><span lang=\\"EN-US\\">sgs</span><span style=\\"font-family: 宋体;\\">检测，达到或超过欧盟权威环保纺织品标准</span><span lang=\\"EN-US\\">oko-texstandard 100</span><span style=\\"font-family: 宋体;\\">与国家</span><span lang=\\"EN-US\\">GB18401-2003</span><span style=\\"font-family: 宋体;\\">环保强制标准，产品可与人贴身接触，做到真正的环保、无刺激、无异味。</span><span lang=\\"EN-US\\"></span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><span lang=\\"EN-US\\">   </span><span style=\\"color: rgb(255, 0, 0);\\"><b><span style=\\"font-family: 宋体;\\">本产品面料经过纳米后整理加工，具备超高的三防性能（防水、防污、抗污），使产品更加容易打理保存！</span></b></span><span lang=\\"EN-US\\"></span></p>\n\n<p class=\\"MsoNormal\\" style=\\"line-height: 150%;\\"><b><span lang=\\"EN-US\\">2</span><span style=\\"font-family: 宋体;\\">、顶级的印染印花工艺——色彩卓越，画面通透</span></b><span lang=\\"EN-US\\"></span></p><p>\n\n<span lang=\\"EN-US\\">    </span><span style=\\"font-family: 宋体;\\">本产品印刷工艺采用世界顶级数码影像拍摄和采集设备，全新纺织品数码真彩还原印花技术和设备，可在本产品上实现超高精度印花，并拥有卓越的色彩表现力，并且任何角度无反光，保证画面非凡的穿透力、实现高档环保材质与完美画面的融合！</span></p>', 0, 0, 328, 0, 0, '高档精细蚕丝/pp棉填充', '', 42, 42, 0, NULL, 0, 0, '', 1, 'font/9109514833.jpg', 'DEJQ', 0, 79, '2011-03-14 17:32:28', 0, '2011-04-25 16:24:45', NULL, NULL, NULL, 101, 0, 0, 0, 1, NULL, NULL, 0);
