(64, 'BB', '', NULL, '', NULL, NULL, NULL, 0, NULL, 1, 0, 0, 0, 0, 0, 1),
(44, '景毛毛', '设计师介绍\r\n姓名：景军\r\n性别：男\r\n所在地：北京\r\n\r\n大学毕业后一直在广告行业从事设计工作，2006年12月开始设计 “景毛毛”原\r\n创玩偶，2007年开始在北京地区销售。并且活跃于各大创意市集。2007年5月正式成立了景毛毛艺术设计工作室，注册了属于自己的品牌——景毛毛。\r\n景毛毛品牌以原创玩偶为主要产品，我们以年轻人的敏锐和激情,开发设计针对年轻人的个性玩偶,并陆续开发出相应的周边产品。\r\n我们希望我们的的客户是:15至35岁的年轻人,及所有“长不大”的男孩女孩\r\n\r\n', NULL, '', NULL, NULL, NULL, 0, 'F', 1, 0, 0, 0, 0, 0, 1),
(45, '关福来', '', NULL, '', NULL, NULL, NULL, 0, 'FSCU', 1, 0, 0, 0, 0, 0, 1),
(46, 'KIRORO', '工作室创立于2008年9月\n工作室名称：como手工玩具工作室\n业务范围：主要设计和生产非量产化的手工毛绒玩具，目前以毛绒兔子为主\n\n设计理念：希望每个看到我们的产品的人都能够感到幸福和快乐。\n\n品牌文化：como品牌起源于文化创意产业发展初期，以格子公社为载体，以设计师kiroro为中心，经过初期艰难的创业阶段，本着不断更新，不断前进的原则。目前已经设计生产出了一批颇受广大用户喜爱的毛绒产品。\n产品风格：以简单和可爱为主基调，设计毛绒类玩具和实用产品。\n\n', NULL, '', NULL, NULL, NULL, 0, 'FSCU', 1, 0, 0, 0, 0, 0, 1),
(48, 'DAMAGE', '', NULL, '', NULL, NULL, NULL, 0, NULL, 1, 0, 0, 0, 0, 0, 1),
(49, '80城堡 ', '', NULL, '', NULL, NULL, NULL, 0, NULL, 1, 0, 0, 0, 0, 0, 1),
(50, 'Baos Baos', '', NULL, '', NULL, NULL, NULL, 0, NULL, 1, 0, 0, 0, 0, 0, 1),
(51, 'Fayer', '', NULL, '', NULL, NULL, NULL, 0, NULL, 1, 0, 0, 0, 0, 0, 1),
(96, '白乌鸦手作', '白乌鸦手作成立于2008年，作品多是实用又简洁的包包袋袋为主。\n白乌鸦一直坚持手工原创设计，所有作品均非量产。\n白乌鸦的作品与流行无关，与诚恳的手作心意有关，陆续推出的作品在创意市集及格子店里都得到了不少朋友的喜欢和肯定。\n简单有趣的设计希望给你的生活带来莞尔一笑的乐趣。\n', NULL, '各种手工包类服饰', NULL, NULL, NULL, 0, 'B', 1, 0, 0, 0, 0, 0, 1),
(53, 'Panda Queen', 'PandaQueen品牌于2006年创立于北京。熊猫PandaQueen是一只生活在都市中的“青年小熊猫”，日出而做，日落而息。身为国宝的“它”钟情艺术、热爱生活、喜欢旅游、执着于生活中的点滴快乐。', NULL, '', NULL, NULL, NULL, 0, 'F', 1, 0, 0, 0, 0, 0, 1),
