(63, '咪克咪克', '', NULL, '', NULL, NULL, NULL, 0, NULL, 1, 0, 0, 0, 0, 0, 1),
(65, 'D1DO', 'DIDO是一个原创设计工作室，创始人分别毕业于清华大学美术学院工艺美术系，北京舞蹈学院艺术设计系舞美设计专业，以及中央美术学院版画系。\n\n理念:”做自己喜欢的事情，做最棒的自己。”\n主打产品：时尚“环”保包\n风格：最前沿的概念设计+环保理念+优良做工=D1DO“环”保包', NULL, '', NULL, NULL, NULL, 0, NULL, 1, 0, 0, 0, 0, 0, 1),
