(78, '二人以上', '到目前为止，二人以上所推出的全部作品都是工作室自己制造完成。不假手他人。虽然工作室的成员们并非样样精通的全才，但能够亲手参与制作自己设计的产品，有助于在工艺层面把自己的设计意图贯彻始终。\r\n\r\n在风格方面，我们倒没有明显的限制。不过大概是自然而然产生的结果，大部分的产品是单纯简单外加一些小淘气的感觉。\r\n\r\n大体上，我们希望更多的展示世界上光明美好的一面。就算真实的世界不是那么美好，我们也希望自己的作品让人们的生活感觉上更美好一些。\r\n', NULL, '', NULL, NULL, NULL, 0, NULL, 1, 0, 0, 0, 0, 0, 1),
(79, 'BANBANK', '', NULL, '', NULL, NULL, NULL, 0, 'A', 1, 0, 0, 0, 0, 0, 1),
