(81, '五度水', '', NULL, '', NULL, NULL, NULL, 0, NULL, 1, 0, 0, 0, 0, 0, 1),
(83, '小团子', '', NULL, '', NULL, NULL, NULL, 0, NULL, 1, 0, 0, 0, 0, 0, 1),
(86, 'MORMULA', 'MORMULA的设计坚持以环保、动物和生活文化为关注点，进行设计与创作。\r\n设计与创造充满情感的产品，关注人们熟悉的确又将其忽视的事物。我相信设计虽然不能改变太多现实的事情，但可以让人们知道了解更多。\r\n\r\nMORMULA以纸品为主打产品。\r\n现阶段以鲜艳的色彩、简约的图形为MORMULA的产品风格，视觉上的风格会随着设计而变化，而设计的情感与内涵是不会发生改变的。\r\n', NULL, '', NULL, NULL, NULL, 0, 'ECBX', 1, 0, 0, 0, 0, 0, 1),
