(115, '其他', '', NULL, '', NULL, NULL, NULL, 0, 'BFOI', 1, 0, 0, 0, 0, 0, 1),
(116, '布拉图', '布拉图是近期崛起的创意手工玩偶品牌。\n布拉图的定位：做世界上最美好的玩偶。它之所以是美的，原因在于它是美好心灵的作物；它代表一种广阔又独特的生活态度。意在呈现一种恣意绽放的生命律动。为手工劳作的重现寻找到一种更为持久的方式，使这一古老又日常的手艺得以在布拉图的创作中被再现、被延续，注入更多创造性的可能。他将努力使人们得到舒缓绵延的欢愉情感，这份欢愉是要令人信服的。所属于布拉图的每一款产品的诞生，其过程都依循艺术创作的法则，它的核心作用于创作者的心灵流露和共振，它具备自然之物应有的精神内质。它是鲜活的，是可以与其对视和私语的。我们从深处的生活和自然当中汲取养分，以内心或奔突或绵缓的强度赋予产品以灵魂。它们独一无二，不可替代。\n', NULL, '', NULL, NULL, NULL, 0, 'FSCU', 1, 0, 0, 0, 0, 0, 1),
(117, '石榴之屋', '夏至*石榴之屋主要制作并出售的是手工配饰制品，各系列商品材料有限，因此都是小批量的，大部分款式不会超过30个，一旦售罄将不再有同款。手工制品即使是同款，也一定会有微妙的美丽区别，我们只能保证每一只都是精心制作，使其独一无二。', NULL, '', NULL, NULL, NULL, 0, 'C', 1, 0, 0, 0, 0, 0, 1),
(118, '小磊', '', NULL, '', NULL, NULL, NULL, 0, 'C', 1, 0, 0, 0, 0, 0, 1),
(119, '麦兜兜', '', NULL, '', NULL, NULL, NULL, 0, 'B', 1, 0, 0, 0, 0, 0, 1);
